import styled from 'styled-components';

export const TextArea = styled.textarea`
  display: block;
  font-size: 10px;
  width: 100%;
  height: 30px;
  border: 1px solid black;
  outline: none;
  background-image: none;
  appearance: none;
  background-color: transparent;
  box-shadow: none;
`;
